//supplychain.sol
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract AgriSupplyChain {
    // Structure to store farmer details
    struct Farmer {
        address farmerAddress;  // Address of the farmer
        string name;            // Name of the farmer
        bool isRegistered;      // Registration status
    }

    // Structure to store product details
    struct Product {
        uint256 id;             // Unique product ID
        string name;            // Product name
        string source;          // Product source (e.g., farm)
        string destination;     // Product destination (e.g., warehouse)
        uint256 timestamp;      // Timestamp when the product was added
        bool deleted;           // Flag to mark product as deleted
    }

    // State variables
    mapping(address => Farmer) public farmers;   // Mapping to store farmers
    mapping(uint256 => Product) private products; // Mapping to store products
    uint256 public productCount;                  // Counter for the total number of products

    // Events
    event FarmerRegistered(address indexed farmerAddress, string name);
    event ProductAdded(
        uint256 indexed id,
        string name,
        string source,
        string destination,
        uint256 timestamp
    );
    event ProductDeleted(uint256 indexed id);

    // Modifier to restrict access to registered farmers
    modifier onlyFarmer() {
        require(farmers[msg.sender].isRegistered, "You must be a registered farmer.");
        _;
    }

    // Constructor (optional)
    constructor() {
        productCount = 0; // Initialize product count to zero
    }

    // Function to register a farmer
    function registerFarmer(string memory _name) public {
        require(!farmers[msg.sender].isRegistered, "Farmer is already registered.");
        require(bytes(_name).length > 0, "Name cannot be empty.");
        
        farmers[msg.sender] = Farmer({
            farmerAddress: msg.sender,
            name: _name,
            isRegistered: true
        });

        emit FarmerRegistered(msg.sender, _name);
    }

    // Function to check if an address is a registered farmer
    function isFarmerRegistered(address _farmerAddress) public view returns (bool) {
        return farmers[_farmerAddress].isRegistered;
    }

    // Function to add a product (only for registered farmers)
    function addProduct(
        string memory _name,
        string memory _source,
        string memory _destination
    ) public onlyFarmer {
        require(bytes(_name).length > 0, "Product name cannot be empty.");
        require(bytes(_source).length > 0, "Product source cannot be empty.");
        require(bytes(_destination).length > 0, "Product destination cannot be empty.");

        productCount++;
        products[productCount] = Product({
            id: productCount,
            name: _name,
            source: _source,
            destination: _destination,
            timestamp: block.timestamp,
            deleted: false // Set the product as not deleted initially
        });

        emit ProductAdded(productCount, _name, _source, _destination, block.timestamp);
    }

    // Function to delete a product (only for registered farmers)
    function deleteProduct(uint256 _id) public onlyFarmer {
        require(_id > 0 && _id <= productCount, "Invalid product ID.");
        
        // Mark the product as deleted
        products[_id].deleted = true;  // Flag the product as deleted
        emit ProductDeleted(_id);
    }

    // Function to get a product by ID
    function getProduct(uint256 _id)
        public
        view
        returns (
            uint256 id,
            string memory name,
            string memory source,
            string memory destination,
            uint256 timestamp
        )
    {
        require(_id > 0 && _id <= productCount, "Invalid product ID.");
        
        Product memory product = products[_id];
        require(!product.deleted, "This product has been deleted."); // Ensure the product is not deleted

        return (product.id, product.name, product.source, product.destination, product.timestamp);
    }
}
